import React, {useState} from 'react'

import {Authorize} from "../../containers"
import { Loading } from '../../components';

const AutorizePage = () => {
    const [autorized, setAutorized] = useState(null);
    const [loading, setLoading] = useState(true);
    
    return (
        <div >
            {console.log(autorized&&loading),console.log(loading)}
            {
                autorized && loading === false ? <Authorize></Authorize> : Loading
            }    
        </div>
    )
}

export default AutorizePage
